import { Component } from '@angular/core';

@Component({
  selector: 'app-generate-otp',
  templateUrl: './generate-otp.component.html',
  styleUrls: ['./generate-otp.component.css']
})
export class GenerateOTPComponent {
  email = ""
  generateOTP()
}
